import React from "react";
import { Paper, Divider, } from "@material-ui/core";
import Grid from "@material-ui/core/Grid";
import { makeStyles , MuiThemeProvider } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import { storiesOf } from "@storybook/react";
import themes from "../../Theme/themes";
import { BrandType } from "../../types/brand";
import Stops from "../Stops";

const useStyles = makeStyles((theme) => ({
    root: {
        background: theme.palette.background.default,
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    darkBg: {
        background: "rgba(0, 0, 0, 0.6)",
        boxShadow: theme.shadows[8],
        padding: "30px",
    },
    stop: {
        marginBottom: theme.spacing(1),
    },
}));

type StopsStoryProps = {
    mode: string,
    brand: BrandType,
    qtd: number
}

const StopsStory = ({
    mode, brand, qtd
}: StopsStoryProps) => {
    const classes = useStyles(themes[brand]);

    return (
        <MuiThemeProvider theme={themes[brand]}>
            <Paper className={classes[mode]} id="Stops">
                <Typography variant="h3">Stops</Typography>
                <br />
                <Divider />
                <br />
                <Grid item>
                    <Stops className={classes.stop} qtd={qtd}/> {qtd} Parada
                </Grid>
            </Paper>
        </MuiThemeProvider>

    );
};

const argsControls = {
    args: {
        brand: "CVC",
        mode: "root",
        qtd: 1,
    },
    argTypes: {
        brand: {
            type: "select",
            options: ["BlackAndWhite", "BlackFriday", "CVC", "CVCCorp", "CVCYellow", "Sub"]
        },
        mode: {
            type: "select",
            options: ["root", "darkBg"]
        },
        qtd: { 
            type: "number",
            min: 1, 
            max: 2
        }
    }
}

storiesOf("Components/Stops", module).addParameters({ storySource: { source: __STORY__, locationsMap: __LOCATIONS_MAP__ } })
    .add("Default", (args) => <StopsStory {...args}/>, argsControls);
